script: |
  super -f text -I q1211.spq | sort > q1211.out

inputs:
  - name: q1211.spq
    data: |
      SELECT col1, col0 * - col0 * - - col2 * - col0 * 66 FROM tab1 (FORMAT parquet) cor0 WHERE NOT 26 * + - col1 NOT BETWEEN 49 * + + col0 + 57 AND - 59 * - ( - - ( col2 ) );
  - name: tab1

outputs:
  - name: q1211.out
    data: |
